const Navigation = () => {
  return (
    <>
      <div class="nav">
        <div class="logo">
          <a href="https://netflix-techarmy.me/">
            <img src="./netflix-logo-png-2583.png" class="logo-l" alt="" />
          </a>
        </div>
        <div class="items">
          <a href="https://netflix-techarmy.me/" class="home">
            Home
          </a>
          <a href="#type">Movies</a>
        </div>
      </div>
    </>
  );
};

export default Navigation;
